Dinosaurs Alive (Imax)

History Documentary hosted by Michael Douglas, published by Giant Screen Films in 2008 - English narration


Information
------------------------------

Dinosaurs Alive! 
Dinosaurs Alive is a global adventure of science and discovery -featuring the earliest dinosaurs of the Triassic Period to the monsters of the Cretaceous &quot;reincarnated&quot; life-sized for the giant IMAX screen. Audiences will journey with some of the world's preeminent paleontologists as they uncover evidence that the descendents of dinosaurs still walk (or fly) among us.

From the exotic, trackless expanses and sand dunes of Mongolia's Gobi Desert to the dramatic sandstone buttes of New Mexico, the film will follow American Museum of Natural History (AMNH) paleontologists as they explore some of the greatest dinosaur finds in history. Through the magic of scientifically accurate computer-generated animation, these newly discovered creatures, and some familiar favorites, will come alive...in a big way!

